 Involved Vehicles:**\n","\n","- **Number of Vehicles Involved (VE_TOTAL):** The total number of vehicles involved ranges from 1 to 59, with 59 being the maximum value and an average of 1.5. \n","\n","- **Number of Moving Vehicles Involved (VE_FORMS):** The most common value is 1, with a maximum value also of 59. We anticipate the presence of an outlier that needs to be addressed to extract more information from this variable.\n","\n","- **Number of Parked Vehicles Involved (PVH_INVL):** Regarding this variable, it is typical that there are no parked vehicles in the incidents recorded in this dataset. However, there are isolated cases where up to 10 parked cars were involved.\n"]},{"cell_type":"code","execution_count":6,"id":"255f6d09","metadata":{"execution":{"iopub.execute_input":"2024-01-18T22:50:54.79446Z","iopub.status.busy":"2024-01-18T22:50:54.792732Z","iopub.status.idle":"2024-01-18T22:50:55.927604Z","shell.execute_reply":"2024-01-18T22:50:55.925515Z"},"papermill":{"duration":1.14676,"end_time":"2024-01-18T22:50:55.930071","exception":false,"start_time":"2024-01-18T22:50:54.783311","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["      PEDS           PERSONS          PERMVIT         PERNOTMVIT    \n"," Min.   :0.0000   Min.   : 0.000   Min.   : 0.000   Min.   :0.0000  \n"," 1st Qu.:0.0000   1st Qu.: 1.000   1st Qu.: 1.000   1st Qu.:0.0000  \n"," Median :0.0000   Median : 2.000   Median : 2.000   Median :0.0000  \n"," Mean   :0.2285   Mean   : 2.173   Mean   : 2.163   Mean   :0.2387  \n"," 3rd Qu.:0.0000   3rd Qu.: 3.000   3rd Qu.: 3.000   3rd Qu.:0.0000  \n"," Max.   :8.0000   Max.   :61.000   Max.   :61.000   Max.   :9.0000  "]},"metadata":{},"output_type":"display_data"},{"name":"stdout","output_type":"stream","text":["[1] 1\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXwU9f3H8e/M7JFsbhIkAsotaBDkaC0oIki8qgU5hGIjlygIApV6AkJF8SxE\nVEQtalUUUKuIYhV+VLAFKSSKcomK4AFEztx7ZGd+f